import Vue from 'vue'
import Router from 'vue-router'
import Home from './components/RotatorMain.vue'
import Light from './components/RotatorLight.vue'

import RotatorDataset from './components/RotatorDataset.vue'
Vue.use(Router)


const router = new Router({
  routes: [
    {
      path: '/',
      name: 'home',
      component: Home
    },
    {
      path: '/data',
      name: 'data',
      component: RotatorDataset
    },
    {
      path: '/light',
      name: 'light',
      component: Light
    }
  ]
})
router.beforeEach((to, from, next) => {
  if (to.matched.some(record => record.meta.reuse === false)) {
    app.key = to.path
  } else {
    app.key = null
  }
  next()
})
export default router
